(6, 1, '2024-04-29 21:13:29', '2024-04-29 21:13:29', '<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://media.licdn.com/dms/image/D4D12AQGcSqvP1bZKew/article-inline_image-shrink_1500_2232/0/1712320214875?e=1720051200&amp;v=beta&amp;t=7oaGohClFQCvV1krvRYNTcyiP9AiNZFJNDFuGdEino0\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p id=\"ember45\">Carnegie Mellon University\'s Industry Innovation Lab (IIL) in Africa has two exciting programs for tech startups: the Business Incubation Program and the Tech Skills Marketplace Program. The Business Incubation Program is a 12-month initiative for startups with a proof-of-concept prototype and a preliminary market assessment. Selected startups receive $40,000 USD, expert consulting services, Amazon Web Services credits, introductions to investors, access to business development workshops, and a workspace in Kigali Innovation City. The Tech Skills Marketplace Program is a unique opportunity for startups to hire CMU-Africa students as interns from May to August. CMU-Africa co-funds the internship to support the startup, providing three months of engineering talent, co-funding of interns, and a chance to assess potential employees.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"ember46\">Both programs offer invaluable resources and support for startups looking to grow and scale their businesses. The deadline for applications is April 15, 2024. Don\'t miss out on this opportunity to take your startup to the next level. Apply now through this <a href=\"https://docs.google.com/forms/d/e/1FAIpQLScmHEYGCw99PHPU5LBnuPuOncut-GU0gL0s8-Kdm_kLQrrhaw/viewform\">link</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 class=\"wp-block-heading\" id=\"ember48\">Calling Innovators To Develop A Portfolio For Research And Innovation</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://media.licdn.com/dms/image/D4D12AQGl0d2J3JVdUA/article-inline_image-shrink_1000_1488/0/1712320786952?e=1720051200&amp;v=beta&amp;t=KUAJx3xU5Pg0ub9TKDYlhjAyvyldJlRWCzblEtpTsDM\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p id=\"ember50\">The Ministry of ICT and Innovation, in collaboration with RISA, has launched a call for applications inviting startups and innovators to develop a comprehensive software solution for managing and analyzing research and innovation content. This initiative aims to enhance the efficiency of research and innovation management, attract and support diverse startups, and foster cohorts with international representation.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"ember51\"><strong>Why Participate?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li><strong>Contribute to Rwanda\'s Digital Transformation:</strong> By participating, startups can actively contribute to the advancement of Rwanda\'s digital landscape and help address pressing challenges.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong>Showcase Innovation:</strong> This event provides a platform to showcase innovative solutions to a wide audience, gaining visibility and recognition for the startup\'s work.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong>Collaborate with Experts:</strong> Participants will have the chance to collaborate with government agencies and industry experts, fostering valuable partnerships and gaining insights from experienced professionals in the field.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p id=\"ember53\">Startups and innovators are encouraged to submit their comprehensive software solutions designed to facilitate the efficient management and analysis of research and innovation content before the deadline to be considered for this exciting opportunity. Apply <a href=\"https://workflow.stack.dev.risa.gov.rw/jw/web/userview/ppiRegistrationId/su/_/homePagePPI\">here</a> to participate in Rwandas Digital Transformation. The deadline for applications is on the <strong>16th of April.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\" id=\"ember54\">Startup Spotlight</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"ember55\"><strong>Meet Dope Initiatives:</strong> A startup that built Keza Game Quiz, an online based game that gives comprehensive sexual reproduction and health content for young people.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://media.licdn.com/dms/image/D4D12AQH9fRu0xRBNlA/article-inline_image-shrink_1000_1488/0/1712321036329?e=1720051200&amp;v=beta&amp;t=SL4-x9PT9nbzbAxY88q-6ywZNcg4vPvFUYQ55tf0WkU\" alt=\"\"/><figcaption class=\"wp-element-caption\">Gaelle Abi Gisubizo, Founder of Dope initiatives.</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p id=\"ember57\">\"Keza Game Quiz, an innovative solution by Dope initiatives addressing the critical issue of limited sexual and reproductive health (SRH) education among teenagers and young adults in Rwanda. The team has developed a game-based online quiz application that makes learning about SRH engaging and accessible.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"ember58\">The app\'s interactive format presents SRH-related questions, allowing users to earn points by selecting correct answers and providing immediate feedback for incorrect choices. With seven levels of age-appropriate content, \"Keza Game Quiz\" aims to empower users with essential SRH knowledge while promoting healthier decision-making.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"ember59\">The solution is particularly impactful for teenagers and young people aged 10-24 in Rwanda, including those in high schools and local communities who often lack easy access to comprehensive SRH information due to cultural taboos and limited educational resources. By leveraging smartphone technology and partnering with local organizations, the team ensures broad accessibility and cultural sensitivity, catering to users\' needs and preferences.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"ember60\">Currently in the pilot stage, \"Keza Game Quiz\" has already reached nearly 200 users on Android devices, over 5000 users in secondary schools utilizing computer labs or smart classes, and about 100 users in game centers in Kigali. This early success underscores the solution\'s potential to make a meaningful impact on SRH outcomes and contribute to addressing root causes of SRH barriers in Rwanda. With a community-centered approach and ongoing engagement with stakeholders, the \"Keza Game Quiz\" team is poised to scale and further enhance SRH education among young people, aligning with global efforts for better health and well-being.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"ember61\">Connect with Dope Initiatives on Their LinkedIn:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"ember62\"><a href=\"https://www.linkedin.com/company/keza-game-quiz/\">https://www.linkedin.com/company/keza-game-quiz/</a> to witness their journey to empower women through education and be part of Rwanda\'s thriving ecosystem of innovation and progress.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\" id=\"ember63\">Expert Opinion</h2>\n<!-- /wp:heading -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://media.licdn.com/dms/image/D4D12AQFHErK1DNbYFA/article-inline_image-shrink_1500_2232/0/1712321197423?e=1720051200&amp;v=beta&amp;t=2SKVppxCu6YSFal1tBZG55ZZW3Z4S--aBsvF-v2u_Qc\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>\"We should start by identifying problems as potential business opportunities. The challenges we face are often the best source of innovative solutions and entrepreneurial projects.\" Yvette Ishimwe, founder of Iriba, What I\'m Building Podcast.</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p id=\"ember66\">If you are interested in listening to the entire podcast discussion, watch below:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.linkedin.com/embeds/publishingEmbed.html?articleId=6927740132304560883&amp;li_theme=light\">https://www.linkedin.com/embeds/publishingEmbed.html?articleId=6927740132304560883&amp;li_theme=light</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"ember67\"><a href=\"https://www.linkedin.com/in/yvette-ishimwe-77a98b161/\">Yvette Ishimwe</a> , the founder of Iriba Water Group Rwanda, is a visionary entrepreneur dedicated to addressing the critical issue of water access in underserved communities. Her innovative approach to implementing \'water ATMs\' managed by local youth and women showcases her commitment to empowering marginalized groups while ensuring sustainable access to safe drinking water.</p>\n<!-- /wp:paragraph -->', 'Hanga Pitchfest Roundup EP 18: Interested Innovators Can Apply To CMU Africa\'s Business Incubation Program', '', 'publish', 'open', 'open', '', 'hanga-pitchfest-roundup-ep-18-interested-innovators-can-apply-to-cmu-africas-business-incubation-program', '', '', '2024-04-29 21:13:29', '2024-04-29 21:13:29', '', 0, 'http://localhost/grp4/?p=6', 0, 'post', '', 0),
