gure>\n<!-- /wp:image -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>\"We should start by identifying problems as potential business opportunities. The challenges we face are often the best source of innovative solutions and entrepreneurial projects.\" Yvette Ishimwe, founder of Iriba, What I\'m Building Podcast.</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p id=\"ember66\">If you are interested in listening to the entire podcast discussion, watch below:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.linkedin.com/embeds/publishingEmbed.html?articleId=6927740132304560883&amp;li_theme=light\">https://www.linkedin.com/embeds/publishingEmbed.html?articleId=6927740132304560883&amp;li_theme=light</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"ember67\"><a href=\"https://www.linkedin.com/in/yvette-ishimwe-77a98b161/\">Yvette Ishimwe</a> , the founder of Iriba Water Group Rwanda, is a visionary entrepreneur dedicated to addressing the critical issue of water access in underserved communities. Her innovative approach to implementing \'water ATMs\' managed by local youth and women showcases her commitment to empowering marginalized groups while ensuring sustainable access to safe drinking water.</p>\n<!-- /wp:paragraph -->', 'Hanga Pitchfest Roundup EP 18: Interested Innovators Can Apply To CMU Africa\'s Business Incubation Program', '', 'inherit', 'closed', 'closed', '', '6-revision-v1', '', '', '2024-04-29 21:13:29', '2024-04-29 21:13:29', '', 6, 'http://localhost/grp4/?p=9', 0, 'revision', '', 0),
(10, 1, '2024-04-29 21:20:50', '2024-04-29 21:20:50', '<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://techgyant.com/wp-content/uploads/2024/04/East-African-startup-Triply-joins-Y-Combinators-Winter-2024-batch-800x800.jpg\" alt=\"East-African-startup-Triply-joins-Y-Combinators-Winter-2024-batch\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.facebook.com/sharer.php?u=https://techgyant.com/east-african-startup-triply-joins-y-combinators-winter-2024-batch/\" target=\"_blank\" rel=\"noreferrer noopener\"></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://twitter.com/share?&amp;text=East%20African%20startup%20Triply%20joins%20Y%20Combinator%E2%80%99s%20Winter%202024%20batch.&amp;via=gyanttech&amp;url=https://techgyant.com/east-african-startup-triply-joins-y-combinators-winter-2024-batch/\" target=\"_blank\" rel=\"noreferrer noopener\"></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://pinterest.com/pin/create/bookmarklet/?url=https://techgyant.com/east-african-startup-triply-joins-y-combinators-winter-2024-batch/&amp;media=https://techgyant.com/wp-content/uploads/2024/04/East-African-startup-Triply-joins-Y-Combinators-Winter-2024-batch-1024x1024.jpg\" target=\"_blank\" rel=\"noreferrer noopener\"></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://triply.co/\">Triply</a>, a travel-booking company from Kenya founded by Peter Wachira and Collins Muthinja, has been named the third startup in the&nbsp;<a href=\"https://www.ycombinator.com/companies/?regions=Rwanda\">2024 winter batch of the YCombinator&nbsp;</a>accelerator program alongside two other startups from Nigeria: Miden and Cleva.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Formerly Tripitaca, Triply was launched in 2021 as a solution for travel businesses to execute and sell more efficiently by unifying payments, invoicing, payroll, accounting, operations, and more.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Also read:&nbsp;<a href=\"https://techgyant.com/timbuktoos-billion-dollar-bid-to-back-african-startups/\">Timbuktoo billion-dollar bid to back African startups</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Triply joins the list of Kenyan startups to get selected for the YCombinator program; only 11 startups from Kenya have ever gotten into the accelerator program, with Saida, a fintech company from Nairobi, being the first. As the year progresses, we hope to see more Kenyan and East African startups joining the YCombinator program.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>By capitalizing on the tourism growth in Kenya, Triply has a large market, and both foreigners and Kenyans are exploring the country. As of July 2023, according to&nbsp;<a href=\"https://www.statista.com/statistics/1299281/monthly-number-of-international-visitor-arrivals-in-kenya/\">Statista</a>, Kenya recorded over 158,000 visitor arrivals, a 25,803 increase from the number of arrivals in June 2023.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Also read:&nbsp;<a href=\"https://techgyant.com/5-best-online-legal-services-for-startups-in-2024/\">5 Best Online Legal Services for Startups in 2024</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Before Triply,&nbsp;<a href=\"https://www.linkedin.com/in/peter-wachira-trippi/details/education/\">Peter Wachira</a>&nbsp;was a Chief Executive Officer at Luna Blue, a vacation rental management company in Kenya, and has a Bachelor of Laws degree from Mount Kenya University in Kenya, while&nbsp;<a href=\"https://linkedin.com/in/collins-muthinja-trippi\">Collins Muthinja</a>, his co-founder, was formerly the Chief Technology Officer at Boda Care; an insurtech startup that provides motorcycle operators with affordable insurance covers, he has a Bachelors degree in Computer Science from Jomo Kenyatta University of Agriculture and Technology, Kenya</p>\n<!-- /wp:paragraph -->', 'East African Startup Triply Joins Y Combinators Winter 2024 Batch.', '', 'publish', 'open', 'open', '', 'east-african-startup-triply-joins-y-combinators-winter-2024-batch', '', '', '2024-04-29 21:20:50', '2024-04-29 21:20:50', '', 0, 'http://localhost/grp4/?p=10', 0, 'post', '', 0),
(11, 1, '2024-04-29 21:20:40', '2024-04-29 21:20:40', '', 'East-African-startup-Triply-joins-Y-Combinators-Winter-2024-batch-1160x1160', '', 'inherit', 'open', 'closed', '', 'east-african-startup-triply-joins-y-combinators-winter-2024-batch-1160x1160', '', '', '2024-04-29 21:20:40', '2024-04-29 21:20:40', '', 10, 'http://localhost/grp4/wp-content/uploads/2024/04/East-African-startup-Triply-joins-Y-Combinators-Winter-2024-batch-1160x1160-1.jpg', 0, 'attachment', 'image/jpeg', 0),
(12, 1, '2024-04-29 21:20:50', '2024-04-29 21:20:50', '<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://techgyant.com/wp-content/uploads/2024/04/East-African-startup-Triply-joins-Y-Combinators-Winter-2024-batch-800x800.jpg\" alt=\"East-African-startup-Triply-joins-Y-Combinators-Winter-2024-batch\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.facebook.com/sharer.php?u=https://techgyant.com/east-african-startup-triply-joins-y-combinators-winter-2024-batch/\" target=\"_blank\" rel=\"noreferrer noopener\"></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://twitter.com/share?&amp;text=East%20African%20startup%20Triply%20joins%20Y%20Combinator%E2%80%99s%20Winter%202024%20batch.&amp;via=gyanttech&amp;url=https://techgyant.com/east-african-startup-triply-joins-y-combinators-winter-2024-batch/\" target=\"_blank\" rel=\"noreferrer noopener\"></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://pinterest.com/pin/create/bookmarklet/?url=https://techgyant.com/east-african-startup-triply-joins-y-combinators-winter-2024-batch/&amp;media=https://techgyant.com/wp-content/uploads/2024/04/East-African-startup-Triply-joins-Y-Combinators-Winter-2024-batch-1024x1024.jpg\" target=\"_blank\" rel=\"noreferrer noopener\"></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://triply.co/\">Triply</a>, a travel-booking company from Kenya founded by Peter Wachira and Collins Muthinja, has been named the third startup in the&nbsp;<a href=\"https://www.ycombinator.com/companies/?regions=Rwanda\">2024 winter batch of the YCombinator&nbsp;</a>accelerator program alongside two other startups from Nigeria: Miden and Cleva.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Formerly Tripitaca, Triply was launched in 2021 as a solution for travel businesses to execute and sell more efficiently by unifying payments, invoicing, payroll, accounting, operations, and more.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Also read:&nbsp;<a href=\"https://techgyant.com/timbuktoos-billion-dollar-bid-to-back-african-startups/\">Timbuktoo billion-dollar bid to back African startups</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Triply joins the list of Kenyan startups to get selected for the YCombinator program; only 11 startups from Kenya have ever gotten into the accelerator program, with Saida, a fintech company from Nairobi, being the first. As the year progresses, we hope to see more Kenyan and East African startups joining the YCombinator program.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>By capitalizing on the tourism growth in Kenya, Triply has a large market, and both foreigners and Kenyans are exploring the country. As of July 2023, according to&nbsp;<a href=\"https://www.statista.com/statistics/1299281/monthly-number-of-international-visitor-arrivals-in-kenya/\">Statista</a>, Kenya recorded over 158,000 visitor arrivals, a 25,803 increase from the number of arrivals in June 2023.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Also read:&nbsp;<a href=\"https://techgyant.com/5-best-online-legal-services-for-startups-in-2024/\">5 Best Online Legal Services for Startups in 2024</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Before Triply,&nbsp;<a href=\"https://www.linkedin.com/in/peter-wachira-trippi/details/education/\">Peter Wachira</a>&nbsp;was a Chief Executive Officer at Luna Blue, a vacation rental management company in Kenya, and has a Bachelor of Laws degree from Mount Kenya University in Kenya, while&nbsp;<a href=\"https://linkedin.com/in/collins-muthinja-trippi\">Collins Muthinja</a>, his co-founder, was formerly the Chief Technology Officer at Boda Care; an insurtech startup that provides motorcycle operators with affordable insurance covers, he has a Bachelors degree in Computer Science from Jomo Kenyatta University of Agriculture and Technology, Kenya</p>\n<!-- /wp:paragraph -->', 'East African Startup Triply Joins Y Combinators Winter 2024 Batch.', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2024-04-29 21:20:50', '2024-04-29 21:20:50', '', 10, 'http://localhost/grp4/?p=12', 0, 'revision', '', 0),
