(17, 1, '2024-04-30 07:49:13', '2024-04-30 07:49:13', '<!-- wp:paragraph -->\n<p><img src=\"https://en.igihe.com/local/cache-gd2/2e/02125ff113cc71c59fd02aa9afe053.png?1705561558\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://en.igihe.com/science-technology/article/china-launches-new-cargo-craft-to-send-space-station-supplies#commentsAll\">&nbsp;Comments :&nbsp;0</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>&nbsp;0&nbsp;0</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>China launched cargo spacecraft Tianzhou-7 on Wednesday night to deliver supplies for its orbiting Tiangong space station, according to the China Manned Space Agency (CMSA).</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The Long March-7 Y8 rocket, carrying Tianzhou-7, blasted off at 10:27 p.m. (Beijing Time) from the Wenchang Spacecraft Launch Site in the southern island province of Hainan, the CMSA said.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>After about 10 minutes, Tianzhou-7 separated from the rocket and entered its designated orbit. Its solar panels soon unfolded. The agency declared the launch a complete success.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Wednesdays launch is the first mission of Chinas manned space project this year. It is also the 507th mission of the Long March rocket series.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The mission is the sixth flight of the space station cargo delivery system consisting of the Tianzhou cargo craft and the Long March-7 carrier rocket.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The cargo craft and launch vehicle were respectively developed by the China Academy of Space Technology (CAST) and the China Academy of Launch Vehicle Technology, both of which are affiliated with the China Aerospace Science and Technology Corporation.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tianzhou-7 will take three hours for the rendezvous and docking with the space station. Previous Tianzhou missions regularly took about 6.5 hours in rendezvous and docking. The exception was the Tianzhou-5 mission, which only took about two hours.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tianzhou-7 will adopt a new mode of rendezvous and docking yet to be verified in orbit, which is expected to give better play to the guidance, navigation, and control systems of the spacecraft, according to Li Zhiyong, a researcher at the CAST.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tianzhou-7 is the seventh cargo craft developed by the CAST. \"As an improved fully-sealed cargo craft, it has the largest cargo transport capacity, the highest cargo-delivery efficiency, and the most complete in-orbit support capability in the world,\" said Li.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tianzhou-7 carries more than 260 items of supplies, including those for the astronaut system, space station system, application tasks, and cargo spacecraft system, as well as other engineering goods, featuring a variety of cargo and large-sized items. The total weight of onboard materials reached about 5.6 tonnes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Customized cargo packages for experiment payloads and other large-scale goods, each weighing over 100 kilograms, will be applied in the operation of the space station, space science experiments, and astronaut life support.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tianzhou-7 also sends 2,400 kilograms of living supplies for the astronauts, including Lunar New Year goods and fresh fruits and vegetables. The packaging design has been optimized to ensure longer storage time and freshness.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The application system has loaded Tianzhou-7 with a total of 61 items weighing 473 kilograms, including experiment payloads, experiment units and samples, consumable items, and spare parts, to support continuous space experiments, according to Liu Wei, a researcher at the Technology and Engineering Center for Space Utilization under the Chinese Academy of Sciences.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The items also contain a set of life support devices to keep cell samples in good condition during this mission and a set of microfluidic chips with the temperature kept at 4 degrees Celsius, said Liu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Those items will be transferred to the space stations experiment facility to carry out a total of 33 scientific experiments, such as the effect of space microgravity on human bone cells, the propellant fluid transport and stability under variable gravity, and the growth of nano precious metals in solution under microgravity. The experiments cover fields such as space life science, space material science, microgravity fluid physics, and combustion science, Liu added.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>According to the plan, China will launch the Tianzhou-8 cargo spacecraft from the Wenchang Spacecraft Launch Site this year. The site is the countrys fourth launch site and the only one by the seaside.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><img src=\"https://en.igihe.com/local/cache-vignettes/L1000xH667/p-16-795eb.jpg?1705563592\" width=\"1000\" height=\"667\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A Long March-7 Y8 carrier rocket carrying cargo spacecraft Tianzhou-7 blasts off from the Wenchang Spacecraft Launch Site in south China\'s Hainan Province, Jan. 17, 2024. China launched cargo spacecraft Tianzhou-7 on Wednesday night to deliver supplies for its orbiting Tiangong space station, according to the China Manned Space Agency (CMSA). (Xinhua/Liu Jinhai)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading {\"level\":6} -->\n<h6 class=\"wp-block-heading\">Advertisement</h6>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://en.igihe.com/services/advertisement/uok-may-intake\" target=\"_blank\" rel=\"noreferrer noopener\"></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 class=\"wp-block-heading\">Latest articles</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image\"><a href=\"https://en.igihe.com/science-technology/article/liquid-intelligent-technologies-unveils-free-internet-services-in-musanze-and\"><img src=\"https://en.igihe.com/local/cache-gd2/a5/13218364fef8b34f6ae6dcaef80124.jpg?1711644387\" alt=\"\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":6} -->\n<h6 class=\"wp-block-heading\"></h6>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://en.igihe.com/science-technology/article/liquid-intelligent-technologies-unveils-free-internet-services-in-musanze-and\">Liquid Intelligent Technologies Unveils free internet services in Musanze and Kimironko</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>0</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>0</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image\"><a href=\"https://en.igihe.com/science-technology/article/shenzhou-17-crew-completes-in-orbit-repairs-during-2nd-extravehicular-mission\"><img src=\"https://en.igihe.com/local/cache-gd2/a8/5a4d967f590c4ee2736ee4f2ae6d0a.png?1709378324\" alt=\"\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":6} -->\n<h6 class=\"wp-block-heading\"></h6>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://en.igihe.com/science-technology/article/shenzhou-17-crew-completes-in-orbit-repairs-during-2nd-extravehicular-mission\">Shenzhou-17 crew completes in-orbit repairs during 2nd extravehicular mission</a></p>\n<!-- /wp:paragraph -